css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url("http://gym-k.com/ranking.html") {
  :root{
    --name: "俊";
    --desc: "サーファーマッチョはド淫乱！バルキーなビルダー体型は全身性感帯！";
  }
  a h2:first-child{
    font-size: 0px;
  }
  a h2:first-child::before{
    font-size: 18px;
    content: var(--name);
  }
  a h2:first-child{
    padding-top: 10px !important;
  }
  a img.pGuys {
    box-sizing: border-box;
   background: url("http://gym-k.com/img/guys/shun1.180240.jpg");
    padding-left: 90px;
    background-size: contain;
  }
  div img.pGuys {
    box-sizing: border-box;
   background: url("http://gym-k.com/img/guys/shun1.180240.jpg");
    padding-left: 90px;
    background-size: contain;
  }
  img + p {
    font-size: 0px !important;
  }
  img + p::before{
    font-size: 11.05px !important;
    content: var(--desc);
  }
  img + h2{
    font-size: 0px !important;
  }
  img + h2::before{
    font-size: 15.0833px !important;
    content: var(--name);
  }
    img + h2 + p {
    font-size: 0px !important;
  }
  img + h2 + p::before{
    font-size: 11.05px !important;
    content: var(--desc);
  }
}
